	    return (
	        <div>
		        <div className="card col-md" style={{width:300+'px'}}>
	                    <img src={this.props.src} alt=""/>   
	                    <div className="card-body">
	                        <h4 className="card-title">Գոտի</h4>
	                        <p className="card-text">Բնական կաշի</p>
	                        <p className="card-text">Գինը   16000 դր․</p>
							<button><img src="./img/google.png" alt="my image" onClick={this.myfunction} /></button>
	                        <button style="background: url(myimage.png)" className="btn btn-primary" onClick={this.countAdd} >BUY</button>
	                    	<p>{this.state.counter}</p>
	                    </div>
	            </div>
	        </div>
	    );
	}
}

export default Imgs;
